Had a very special guest for today’s podcast talk!! @jayshetty thank you for joining me to talk all things podcasts, On Purpose and Think Like a Monk!! 🎧📚

We sat down to share our favorite mindfulness podcasts including lessons from the *one and only* @michelleobama’s podcast AND to learn a little bit about self care from @TyAlexander and her podcast @SelfCareIRL!

